import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Box } from '@material-ui/core';
import { GridList } from '@material-ui/core';
import { GridListTile } from '@material-ui/core';
import img1 from './static/qiuqiu_img/qiuqiu.jpg';
import img2 from './static/qiuqiu_img/qiuqiu1.jpg';
import img3 from './static/qiuqiu_img/qiuqiu2.jpg';



class ImgLoader extends React.Component {
	constructor(props) {
		super(props);
	}

	// stylePage = () => {
	// 	this.classes = makeStyles(theme => ({
	// 		gridList: {
	// 			flexWrap: 'nowrap',
	// 			// Promote the list into his own layer on Chrome. This cost memory but helps keeping high FPS.
	// 			transform: 'translateZ(0)',
	// 		},
	// 	}));
	// }

	render() {
		let classes;
		classes = makeStyles(theme => ({
					gridList: {
						flexWrap: 'nowrap',
						// Promote the list into his own layer on Chrome. This cost memory but helps keeping high FPS.
						transform: 'translateZ(0)',
					},
				}));
		return (
			<Box m={2}>
				<GridList className={this.state.classes.gridList} cols={2.5}>
					<GridListTile key={img1}>
						<img src={img1} />
					</GridListTile>
					<GridListTile key={img2}>
						<img src={img2} />
					</GridListTile>
					<GridListTile key={img3}>
						<img src={img3} />
					</GridListTile>
				</GridList>
			</Box>
		)
	}
}

export default ImgLoader
